import React  from "react"
import "./table.css"


const Table = (props) => <div id={props.title} className="main">
    {
    console.log(props.title, (props.title === "Education"))
    }
    <h1 className="title">          
            <i className={(props.title === "Education")? "fas fa-graduation-cap": "fa fa-briefcase"}></i>
          <a> {props.tableName} </a>
    </h1>
    <table>
        <tr>
            <th> # </th>
            {props.header.map(val => <th> {val} </th>)}
        </tr>
        {
            props.details.map((row, pos) => 
                <tr>
                    <td> {pos+1} </td>
                    {props.header.map(val => <td> {row[val]} </td>)}
                </tr>
            )
        }
    </table>
</div>

export default Table;
